import { action, observable, decorate } from "mobx";
import Model from "./Model";

class User extends Model {
  constructor(props) {
    const defaults = {
      _id: 0,
      fullName: "",
      coopName: "",
      username: "",
      password: "",
      rpassword: "",
      currAddress: "",
      contactNum: 0
    };
    super({ ...defaults, ...props });
  }

  reset = {
    _id: 0,
    fullName: "",
    coopName: "",
    username: "",
    password: "",
    rpassword: "",
    currAddress: "",
    contactNum: 0
  };
}
decorate(User, {
  _id: observable,
  fullName: observable,
  coopName: observable,
  username: observable,
  password: observable,
  rpassword: observable,
  currAddress: observable,
  contactNum: observable
});

export default User;

